description:
Shauna Grant and friends invite you into their world of erotic adventure and experimentation in this interesting film. Each segment is designed to involve the viewers directly in the action. The actors and actresses talk to the viewers throughout their heated encounters, inviting them to imagine themselves in on the passion. It's an idea that really works -- the sex is certainly sultry to begin with, but the added jolt of hearing the performers talking right to you takes this film over the top and into the upper reaches of adult film.

